&lt;p dir="ltr"&gt;&lt;strong&gt;Colorado Springs, CO &lt;/strong&gt;&lt;span style="font-size:11pt"&gt;&mdash; The 28th Annual YMCA Turkey Trot 5k race occurs on Thanksgiving morning, November 27th, 2025. The ever-popular Colorado Springs Thanksgiving Day tradition has more than 3,500 registrants ready to come out and kick-start their Thanksgiving Day with a run or walk, and many bring their furry friends.&amp;nbsp; Registration is still open; visit &lt;/span&gt;&lt;a href="http://ppymca.org/turkeytrot" style="text-decoration-line: none;"&gt;&lt;span style="color:rgb(17, 85, 204); font-size:11pt"&gt;ppymca.org/turkeytrot&lt;/span&gt;&lt;/a&gt;&lt;span style="font-size:11pt"&gt; to register today!&amp;nbsp;&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p dir="ltr"&gt;&lt;span style="font-size:11pt"&gt;The Turkey Trot is part of the YMCA of the Pikes Peak Region's Annual 5K Race Series and takes place at the Briargate Family Y at &lt;/span&gt;&lt;span style="background-color:rgb(255, 255, 255); color:rgb(32, 33, 36); font-size:11pt"&gt;4025 Family Place, Colorado Springs. &lt;/span&gt;&lt;span style="font-size:11pt"&gt;The &lt;/span&gt;&lt;strong&gt;Kids&rsquo; Tiny Trot&lt;/strong&gt;&lt;span style="font-size:11pt"&gt;, a free fun run, kicks off at &lt;/span&gt;&lt;strong&gt;8:15 a.m.&lt;/strong&gt;&lt;span style="font-size:11pt"&gt;, followed by the &lt;/span&gt;&lt;strong&gt;Turkey Trot 5K at 9:00 a.m.&lt;/strong&gt;&lt;span style="font-size:11pt"&gt; Both races are &lt;/span&gt;&lt;strong&gt;stroller and dog-friendly&lt;/strong&gt;&lt;span style="font-size:11pt"&gt;, making this an inclusive event for the entire community.&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p dir="ltr"&gt;&lt;span style="font-size:11pt"&gt;A holiday-season tradition, the race series raises funds for the YMCA programs. All proceeds help individuals and families in the Pikes Peak Region gain access to programs such as child care, swim lessons, and youth sports.&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p dir="ltr"&gt;&lt;span style="background-color:rgb(255, 255, 255); font-size:11pt"&gt;The Turkey Trot 5k is &lt;/span&gt;&lt;span style="font-size:11pt"&gt;fun for the whole family, and costumes are encouraged. Registration is still open at ppymca.org/turkeytrot. The series' final race, the Jingle Jog 5K, occurs on December 13, 2025. Visit ppymca.org/jinglejog to register.&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;&lt;br /&gt;
&lt;span style="font-family:arial,sans-serif; font-size:11pt"&gt;&ldquo;The Turkey Trot embodies everything the YMCA stands for &mdash; community, health, and gratitude,&rdquo; said &lt;/span&gt;&lt;strong&gt;Theresa Johnson, EVP/COO of the YMCA of the Pikes Peak Region&lt;/strong&gt;&lt;span style="font-family:arial,sans-serif; font-size:11pt"&gt;. &ldquo;We&rsquo;re thrilled to see families make this event part of their Thanksgiving tradition while giving back to those who need us most. We would also like to thank your generous sponsors who help make this event possible. Dave &amp;amp; Buster&rsquo;s, Raising Cane&rsquo;s, FOX21, Natural Grocers, Fleet Feet, Corwin Honda, and our Vendor Village&amp;nbsp; Partners.&rdquo;&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;October 27, 2025 | Tesla Professional Development Center&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Colorado Springs, CO &mdash;&lt;/strong&gt; More than 200 middle and high school students from across El Paso County and surrounding areas will gather on &lt;strong&gt;Monday, October 27, 2025&lt;/strong&gt;, for the &lt;strong&gt;Family, Career, and Community Leaders of America (FCCLA) Spanish Peaks District Fall Conference&lt;/strong&gt; at the &lt;strong&gt;Tesla Professional Development Center&lt;/strong&gt;, 2560 International Circle in Colorado Springs.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;FCCLA is a national career and technical student organization focused on &lt;strong&gt;promoting personal growth and leadership development through Family and Consumer Sciences education&lt;/strong&gt;. The conference provides students with opportunities to build communication, teamwork, and leadership skills while connecting classroom learning to real-world experiences.&lt;/p&gt;

&lt;p&gt;This year&rsquo;s fall conference will feature:&lt;/p&gt;

&lt;ul&gt;
     &lt;li&gt;
     &lt;p&gt;&lt;strong&gt;Student-led workshops and roundtable sessions&lt;/strong&gt;&lt;/p&gt;
     &lt;/li&gt;
     &lt;li&gt;
     &lt;p&gt;&lt;strong&gt;Chapter planning and collaboration activities&lt;/strong&gt;&lt;/p&gt;
     &lt;/li&gt;
     &lt;li&gt;
     &lt;p&gt;&lt;strong&gt;District officer elections&lt;/strong&gt;&lt;/p&gt;
     &lt;/li&gt;
     &lt;li&gt;
     &lt;p&gt;&lt;strong&gt;Adviser networking opportunities&lt;/strong&gt;&lt;/p&gt;
     &lt;/li&gt;
&lt;/ul&gt;

&lt;p&gt;Roundtable sessions will take place from &lt;strong&gt;9:30&ndash;11:00 a.m.&lt;/strong&gt;, offering interactive, small-group learning experiences led by peers and professionals. Each session lasts approximately 20 minutes, giving students a chance to rotate through multiple topics and presenters.&lt;/p&gt;

&lt;p&gt;&ldquo;The FCCLA Fall Conference is a chance for students to see leadership in action. They aren&rsquo;t just learning about it, they&rsquo;re living it,&rdquo; said &lt;strong&gt;Annie Friesema&lt;/strong&gt;, FCCLA District Consultant and Family and Consumer Sciences educator in Colorado Springs School District 11.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;About FCCLA&lt;/strong&gt;&lt;br /&gt;
Family, Career, and Community Leaders of America (FCCLA) is a national organization that helps youth develop skills for life through character development, creative and critical thinking, interpersonal communication, and career preparation. Through leadership and career-focused activities, FCCLA members make a difference in their families, schools, and communities.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;FOR IMMEDIATE RELEASE&lt;/strong&gt;&lt;br /&gt;
