&lt;h3&gt;Step Springs to Open Early to Help Men Overcome Addiction&lt;/h3&gt;

&lt;p&gt;&lt;strong&gt;Colorado Springs, CO &mdash; &lt;/strong&gt;&lt;strong&gt;October 27, 2025&lt;/strong&gt; &mdash; Step Springs announced Friday that it will officially open its doors ahead of schedule, with its first residents arriving &lt;strong&gt;Tuesday, October 28&lt;/strong&gt; &mdash; nearly a week earlier than the originally planned opening date of November 3.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;The early opening was made possible because furnishing of the new facility was completed ahead of schedule &mdash; and because several men accepted into the program are ready to begin their recovery journeys.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;Modeled after the proven Step Denver program, Step Springs helps men experiencing homelessness and addiction build a foundation for lasting recovery through the principles of &lt;strong&gt;sobriety, work, accountability, and community&lt;/strong&gt;.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;Located at 4525 Northpark Drive, Step Springs will begin welcoming its first residents on &lt;strong&gt;October 28&lt;/strong&gt;.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Step Springs&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;stepsprings.org&lt;/p&gt;

&lt;ul&gt;
     &lt;li&gt;Residential recovery program for men ages 21+&lt;/li&gt;
     &lt;li&gt;&lt;strong&gt;No cost same-day intake&lt;/strong&gt;, no insurance or Medicaid needed&lt;/li&gt;
     &lt;li&gt;&lt;strong&gt;Safe, clean, sober living environment&lt;/strong&gt; (private room after 30-45 days)&lt;/li&gt;
     &lt;li&gt;&lt;strong&gt;No set timeframe&lt;/strong&gt; or limits to how long you can stay&lt;/li&gt;
     &lt;li&gt;Not a lockdown facility, residents &lt;strong&gt;free to come and go&lt;/strong&gt;&lt;/li&gt;
     &lt;li&gt;&lt;strong&gt;Can work a full-time job&lt;/strong&gt;, Career Center to help you get one&lt;/li&gt;
     &lt;li&gt;Able to &lt;strong&gt;save money for your future&lt;/strong&gt;/transition&lt;/li&gt;
     &lt;li&gt;Peer recovery model (staff are alumni of the program)&lt;/li&gt;
&lt;/ul&gt;

&lt;p&gt;To Apply: Call 719-715-2880 or Walk In (4525 Northpark Drive, Colorado Springs)&lt;/p&gt;

&lt;p&gt;Monday&ndash;Friday from 7:00 a.m.&ndash;12:00 p.m. for intake on the same day at 2:30 p.m.*&lt;/p&gt;

&lt;p&gt;*Can schedule intake if coming from detox, incarceration, or another program. Otherwise, apply on the day you are ready.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;Step gives men with nowhere else to turn the opportunity to overcome addiction through sobriety, work, accountability, and community.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;Photos of the facility can be found here:&amp;nbsp;https://drive.google.com/drive/folders/1HLOOT0BuyzMBkNN2gH1nFrEUg1Slg7tm?usp=sharing&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;COLORADO SPRINGS, Colo. (November 2025) &lt;/strong&gt;&ndash; Silver Key Senior Services invites the community to help fill pantry shelves this holiday season by donating non-perishable food items and pet food during its Bountiful Pantry Food Drive, taking place November 25th and 26th at multiple convenient drop-off locations.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;Every donation will help ensure that local elders&mdash;and their beloved pets&mdash;have nutritious meals this winter. All contributions collected will stay within the local communities where they&rsquo;re donated, directly supporting older adults in need.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Donation Locations and Times:&lt;/strong&gt;&lt;/p&gt;

&lt;ul&gt;
     &lt;li&gt;&lt;strong&gt;King Soopers&lt;/strong&gt; (Briargate &amp;amp; Union) 9225 N Union Blvd, CO Springs, CO 80920

     &lt;ul&gt;
          &lt;li&gt;Donation Window: 10:00 AM &ndash; 2:00 PM both days. &lt;em&gt;Note: Donations will stay in Colorado Springs&lt;/em&gt;&lt;/li&gt;
     &lt;/ul&gt;
     &lt;/li&gt;
     &lt;li&gt;&lt;strong&gt;Safeway&lt;/strong&gt; (Circle &amp;amp; Galley) 1121 N Circle Dr, Colorado Springs, CO 80909
     &lt;ul&gt;
          &lt;li&gt;Donation Window: 10:00 AM &ndash; 3:00 PM both days. &lt;em&gt;Note: Donations will stay in Colorado Springs&lt;/em&gt;&lt;/li&gt;
     &lt;/ul&gt;
     &lt;/li&gt;
     &lt;li&gt;&lt;strong&gt;Westside Community Center &lt;/strong&gt;(17th &amp;amp; West Bijou) 1628 W Bijou St, Colorado Springs, CO 80904
     &lt;ul&gt;
          &lt;li&gt;Donation Window: 10:00 AM &ndash; 2:00 PM both days. &lt;em&gt;Note: Donations will stay in Colorado Springs&lt;/em&gt;&lt;/li&gt;
     &lt;/ul&gt;
     &lt;/li&gt;
     &lt;li&gt;&lt;strong&gt;Tri-Lakes Activity Center &lt;/strong&gt;(Third &amp;amp; Jefferson) 238 3rd St, Monument, CO 80132
     &lt;ul&gt;
          &lt;li&gt;Donation Window: 10:00 AM &ndash; 2:00 PM both days. &lt;em&gt;Note: Donations will stay in Monument/Tri-Lakes&lt;/em&gt;&lt;/li&gt;
     &lt;/ul&gt;
     &lt;/li&gt;
&lt;/ul&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;Silver Key&rsquo;s Bountiful Pantry program operates year-round to provide essential groceries and pet food to older adults who are facing food insecurity. With the growing need in our region, community donations are more important than ever.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&ldquo;Every can, box, or bag you give makes a difference,&rdquo; said Jason DeaBueno, Silver Key CEO &amp;amp; President. &ldquo;These donations help us ensure that elders in our community don&rsquo;t have to choose between buying food and paying for other essentials like medication or utilities.&rdquo;&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;For more information or to learn about volunteer opportunities, contact Silver Key at 719-884-2300 or info@silverkey.org.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Colorado Springs, CO &mdash;&lt;/strong&gt;&amp;nbsp;On &lt;strong&gt;Wednesday, November 6, 2025, from 5:30 to 7:30 p.m.&lt;/strong&gt;, paraprofessionals, substitutes, and anyone interested in becoming a licensed early childhood or K-12 teacher are invited to the &lt;strong&gt;Para to Teacher Pathways in the Pikes Peak Region&lt;/strong&gt;&amp;nbsp;event at the &lt;strong&gt;Tesla Professional Development Center&lt;/strong&gt;, hosted by &lt;strong&gt;Colorado Springs School District 11&lt;/strong&gt;&amp;nbsp;in partnership with &lt;strong&gt;TEACH Colorado&lt;/strong&gt;, the &lt;strong&gt;Colorado Department of Education&lt;/strong&gt;, and local educator preparation programs.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;This free, in-person event will help attendees explore &lt;strong&gt;multiple routes to teacher licensure&lt;/strong&gt;, including traditional and alternative pathways that allow individuals to &lt;strong&gt;earn while they learn&lt;/strong&gt;. Representatives from regional school districts, universities, early childhood councils, and the Colorado Department of Education will provide one-on-one guidance, financial aid resources, and personalized coaching to make the process accessible.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&ldquo;Our paraprofessionals play an essential role in student success every day,&rdquo; said &lt;strong&gt;Jennifer Harris, Senior Executive Director of Talent Management for Colorado Springs School District 11&lt;/strong&gt;. &ldquo;This event gives them the tools, support, and confidence to take the next step in their careers and become licensed educators in our classrooms.&rdquo;&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;The event is part of a regional effort to address teacher shortages and strengthen the educator pipeline by helping those already serving in schools advance to the next level in their profession.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

