&lt;p&gt;&lt;strong&gt;Colorado Springs, CO &mdash; November 5, 2025&lt;/strong&gt; &mdash; Doherty High School invites the Colorado Springs community to join in a heartfelt tribute to the nation&rsquo;s service members during its annual Veterans Day Assembly on Tuesday, November 11, from 10:35 to 11:30 a.m. in the Doherty High School gymnasium, located at 4515 Barnes Road.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;This cherished annual tradition, organized and presented by the Doherty High School NJROTC, is a powerful reminder of the courage, dedication, and sacrifice of those who have served in the United States Armed Forces. The assembly will feature patriotic performances, student tributes, and special recognition of staff members who have served, offering the community an opportunity to reflect on the meaning of service and the enduring spirit of patriotism.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&ldquo;Our Veterans Day Assembly is one of the most meaningful events of the year,&rdquo; said a representative from Doherty High School&rsquo;s NJROTC. &ldquo;It allows our students and community to come together to honor those who have selflessly dedicated their lives to protecting our freedoms.&rdquo;&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;Veterans, active-duty military personnel, families, and community members are warmly encouraged to attend this moving celebration of courage, unity, and gratitude.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

