&lt;p&gt;&lt;strong&gt;The Colorado Springs School Presents&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;"She Kills Monsters"&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;&lt;img src="data:image/png;base64," style="height:264px; width:468px" /&gt;&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;COLORADO SPRINGS, CO&lt;/strong&gt; &ndash; The Colorado Springs School (CSS) Upper School Theatre invites the community to experience an epic journey of adventure, loss, and sisterhood with its production of "She Kills Monsters" by Qui Nguyen. Performances will take place November 13, 14, and 15 at the Louisa Performing Arts Center on campus.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;This action-packed dramatic comedy tells the story of Agnes Evans, a high school teacher who discovers her deceased teenage sister Tilly's Dungeons &amp;amp; Dragons notebook. Seeking to understand the sister she never really knew, Agnes embarks on a quest through Tilly's imaginary world, battling monsters and confronting difficult truths about family, identity, and grief.&lt;/p&gt;

&lt;p&gt;"She Kills Monsters" blends comedy, drama, and fantasy with stage combat choreography and multimedia elements, creating a visually stunning theatrical experience. The production explores themes of geek culture, acceptance, and the power of imagination while celebrating the bond of sisterhood.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;The play features an ensemble cast of talented student actors bringing to life a diverse array of characters, from fierce warriors and dark elves to cheerleaders and dungeon masters. The production showcases the dedication and creativity of CSS students both on stage and behind the scenes.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Performance Details:&lt;/strong&gt;&lt;/p&gt;

&lt;ul&gt;
     &lt;li&gt;&lt;strong&gt;Thursday, November 13, 2025 at 7:00 p.m.&lt;/strong&gt;&lt;/li&gt;
     &lt;li&gt;&lt;strong&gt;Friday, November 14, 2025 at 7:00 p.m.&lt;/strong&gt;&lt;/li&gt;
     &lt;li&gt;&lt;strong&gt;Saturday, November 15, 2025 at 2:00 p.m.&lt;/strong&gt;&lt;/li&gt;
     &lt;li&gt;&lt;strong&gt;Location: Louisa Performing Arts Center @ The Colorado Springs School&lt;/strong&gt;&lt;/li&gt;
&lt;/ul&gt;

&lt;p&gt;The performance is free and open to the public and recommended for audiences age 14+.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;About The Colorado Springs School Theatre Program:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;Director Jonathan Andujar is the Middle and Upper School Theater teacher at CSS and has been active in the arts community of the Pikes Peak region as a poet, director, actor, playwright, and producer since 2012. In 2013, Jonathan was the performance poet of the year (Pikes Peak Arts Council) and qualified for the Colorado Springs national poetry slam team. Directing credits include Frankenstein (CSS), &lt;em&gt;Fahrenheit 451 (CSS ), Starmites (CSS), In the Heights (&lt;/em&gt;Vintage Theatre)&lt;em&gt;, Little Shop of Horrors&lt;/em&gt; and&lt;em&gt; Puffs&lt;/em&gt; (CSS)&lt;em&gt;, Ghost Stories &lt;/em&gt;and Merriments and Mysteries (THEATREdART). Acting credits include;&amp;nbsp;&lt;em&gt;Mother Courage (&lt;/em&gt;General, Soldier, Ensemble) as well as &lt;em&gt;Tall, Tall, Tales&lt;/em&gt; (Paul Bunyan) with the Millibo Art Theatre, &lt;em&gt;Little Shop of Horrors &lt;/em&gt;(Puppeteer) with THEATREWORKS, and &lt;em&gt;Peter and the Starcatcher &lt;/em&gt;(Capt. Scott, Ensemble) with the Fine Arts Center. Playwriting credits include works with the CS Fine Arts Center such as &lt;em&gt;To Slay the Dragon, &lt;/em&gt;and the radio plays&lt;em&gt; Leonidas,&lt;/em&gt; and&lt;em&gt; Invasion!!!&lt;/em&gt; Jonathan is appreciative of The Colorado Springs School for allowing him to continue to expand in his craft.&lt;/p&gt;

&lt;p&gt;&amp;nbsp;&lt;/p&gt;

