&lt;p&gt;&lt;strong&gt;About The Colorado Springs School (CSS)&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;The Colorado Springs School is an independent day school serving students from PreK through grade 12. Through experiential education and superior academics and mentoring, CSS prepares students to think independently and to meet the needs of a dynamic world through belonging, leadership, problem-solving skills, and personal integrity. Learn more at css.org. The school is located on a historic property of 28 acres at 21 Broadmoor Avenue, Colorado Springs, CO 80906.&lt;/p&gt;

