&lt;p&gt;Trailblazer Elementary School will celebrate its annual &lt;strong&gt;&lt;u&gt;Lantern Night on Thursday, November 20, 2025, 5:30-7:00PM&lt;/u&gt;&lt;/strong&gt;, throughout the Trailblazer campus (2015 Wickes Rd., Colorado Springs, 80919)!&amp;nbsp; This traditional event highlights the great things happening inside our building and around our school campus.&amp;nbsp; We&rsquo;ll have student artwork and learning on display, Scholastic Book Fair in our studio, activities in our learning pods, photo booth, hot cider, s&rsquo;mores and more.&amp;nbsp; Outside, we invite visitors to take the illuminated Lantern Walk throughout Wickes Park adjacent to the Trailblazer campus!&lt;br /&gt;
&amp;nbsp;&lt;/p&gt;

&lt;p&gt;At Trailblazer, we&rsquo;re going places!&amp;nbsp; Our students and staff are co-creators in our unique Westside learning experiences. Learners participate in daily opportunities to collaborate, problem-solve, create, and take their own steps on the &lt;a href="https://www.d11.org/administration/superintendent/roadmap"&gt;D11 Road Map to Excellence&lt;/a&gt;.&amp;nbsp;We create strong and engaging learning and exploration with a supportive culture of safety, kindness, respect and responsibility.&lt;/p&gt;

